import React from 'react';
import './signin.css'

function signin() {
  return (
    <div className='signin flex h-screen overflow-hidden'>
      <div className="w-1/2 signin-svg-background ">
      <h4 className='logo p-5 m-5 text-left'>Logo</h4>
      <h1 className='board text-center'>Board.</h1>
      </div>
      <div className="w-1/2">
        {/* Content for the right column */}
        bye
      </div>
    </div>
  )
}

export default signin
